MyPacket& MyPacket::operator=(const MyPacket& other)
{
    if (this == &other) return *this;
    ::inet::FieldsChunk::operator=(other);
    copy(other);
    return *this;
}

void MyPacket::copy(const MyPacket& other)
{
    this->senderID = other.senderID;
    this->dataLen = other.dataLen;
    delete [] this->data;
    this->data = (other.data_arraysize==0) ? nullptr : new int[other.data_arraysize];
    data_arraysize = other.data_arraysize;
    for (size_t i = 0; i < data_arraysize; i++) {
        this->data[i] = other.data[i];
    }
}

void MyPacket::parsimPack(omnetpp::cCommBuffer *b) const
{
    ::inet::FieldsChunk::parsimPack(b);
    doParsimPacking(b,this->senderID);
    doParsimPacking(b,this->dataLen);
    b->pack(data_arraysize);
    doParsimArrayPacking(b,this->data,data_arraysize);
}

void MyPacket::parsimUnpack(omnetpp::cCommBuffer *b)
{
    ::inet::FieldsChunk::parsimUnpack(b);
    doParsimUnpacking(b,this->senderID);
    doParsimUnpacking(b,this->dataLen);
    delete [] this->data;
    b->unpack(data_arraysize);
    if (data_arraysize == 0) {
        this->data = nullptr;
    } else {
        this->data = new int[data_arraysize];
        doParsimArrayUnpacking(b,this->data,data_arraysize);
    }
}

