size_t MyPacket::getDataArraySize() const
{
    return data_arraysize;
}

int MyPacket::getData(size_t k) const
{
    if (k >= data_arraysize) throw omnetpp::cRuntimeError("Array of size data_arraysize indexed by %lu", (unsigned long)k);
    return this->data[k];
}

void MyPacket::setDataArraySize(size_t newSize)
{
    handleChange();
    int *data2 = (newSize==0) ? nullptr : new int[newSize];
    size_t minSize = data_arraysize < newSize ? data_arraysize : newSize;
    for (size_t i = 0; i < minSize; i++)
        data2[i] = this->data[i];
    for (size_t i = minSize; i < newSize; i++)
        data2[i] = 0;
    delete [] this->data;
    this->data = data2;
    data_arraysize = newSize;
}

void MyPacket::setData(size_t k, int data)
{
    if (k >= data_arraysize) throw omnetpp::cRuntimeError("Array of size  indexed by %lu", (unsigned long)k);
    handleChange();
    this->data[k] = data;
}

void MyPacket::insertData(size_t k, int data)
{
    handleChange();
    if (k > data_arraysize) throw omnetpp::cRuntimeError("Array of size  indexed by %lu", (unsigned long)k);
    size_t newSize = data_arraysize + 1;
    int *data2 = new int[newSize];
    size_t i;
    for (i = 0; i < k; i++)
        data2[i] = this->data[i];
    data2[k] = data;
    for (i = k + 1; i < newSize; i++)
        data2[i] = this->data[i-1];
    delete [] this->data;
    this->data = data2;
    data_arraysize = newSize;
}

void MyPacket::insertData(int data)
{
    insertData(data_arraysize, data);
}

void MyPacket::eraseData(size_t k)
{
    if (k >= data_arraysize) throw omnetpp::cRuntimeError("Array of size  indexed by %lu", (unsigned long)k);
    handleChange();
    size_t newSize = data_arraysize - 1;
    int *data2 = (newSize == 0) ? nullptr : new int[newSize];
    size_t i;
    for (i = 0; i < k; i++)
        data2[i] = this->data[i];
    for (i = k; i < newSize; i++)
        data2[i] = this->data[i+1];
    delete [] this->data;
    this->data = data2;
    data_arraysize = newSize;
}

